import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open the mobile menu
    await page.waitForSelector('.nav-menu', { timeout: 5000 });
    await page.click('.nav-menu');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_mobile_menu_opened.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_mobile_menu_opened.png'));

    // Verify the mobile menu is displayed
    await page.waitForSelector('.mobile-menu', { timeout: 5000 });
    const isMenuVisible = await page.isVisible('.mobile-menu');

    // Click on a category link in the mobile menu
    await page.waitForSelector('a:has-text("Electronics")', { timeout: 5000 });
    await page.click('a:has-text("Electronics")');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_electronics_category_selected.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_electronics_category_selected.png'));

    // Extract the title of the page to verify navigation
    await page.waitForSelector('h2', { timeout: 5000 });
    const pageTitle = await page.textContent('h2');

    return {
      success: true,
      action: "Navigated to Electronics category from mobile menu",
      extractedData: { pageTitle },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
